import React from "react";
import "./NewItems.css";
import Thumbnail from "./Thumbnail";

function NewItems() {
  return (
    <>
      <div class="container">
        <div class="thumbnail-container">
          <Thumbnail />
          <Thumbnail />
          <Thumbnail />
        </div>
      </div>
    </>
  );
}

export default NewItems;
